import React, { useContext, useState }  from 'react';
import Login from '../components/homePage/Login';
import Register from '../components/homePage/Register';
import MapsTable from '../components/homePage/MapsTable';
import { UserContext } from '../components/UserContext';

function Home() {
  const {user, setUser} = useContext(UserContext);
  const [active, setActive] = useState("LoginCard");

  return (
    <div className='Home'>

      {user ? (<MapsTable/>):(
        (active === "LoginCard" && <Login />)
        (active === "LoginCard" &&<button onClick={() => setActive("RegisterCard")}>Register</button>)
        (active === "RegisterCard" && <Register/>)
        (active === "RegisterCard" &&<button onClick={() => setActive("LoginCard")}>Login</button>)
      )}

    </div>

  );
}

export default Home;
